import csvimport loggingwith open('Trails.csv', 'r') as file:    reader = csv.reader(file)    i = 0    conditionList = {}    installationYear = {}    for row in reader:                # if i == 0:        #     print(row)        conditionList[row[2]] = row[9]        if i > 0 and len(row[10]) > 0:            year = int(row[10])            if year > 2000:                installationYear[row[2]] = year                i = i+1for key in conditionList:            print(key, conditionList[key])        for key in installationYear:            print(key, installationYear[key])